import React, { useState, useEffect } from 'react';
import Calendar from 'react-calendar';
import 'react-calendar/dist/Calendar.css';
import Navbar from './Navbar';
import axios from 'axios';

function CustomCalendar() {
  const [date, setDate] = useState(new Date());
  const [currentMonth, setCurrentMonth] = useState(date.getMonth());
  const [currentYear, setCurrentYear] = useState(date.getFullYear());
  const [events, setEvents] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchEvents();
  }, [currentMonth, currentYear]);

  const fetchEvents = async () => {
    try {
      const response = await axios.get('http://localhost:4000/calendar', {
        params: {
          month: currentMonth,
          year: currentYear,
        },
      });
      setEvents(response.data);
      setLoading(false);
    } catch (error) {
      console.error('Error fetching events:', error);
    }
  };

  const tileContent = ({ date, view }) => {
    const eventForDate = events.find(
      (event) =>
        event.date.getFullYear() === date.getFullYear() &&
        event.date.getMonth() === date.getMonth() &&
        event.date.getDate() === date.getDate()
    );
    return eventForDate ? (
      <div
        style={{
          backgroundColor: eventForDate.color,
          color: '#fff',
          padding: '5px',
          borderRadius: '5px',
        }}
      />
    ) : null;
  };

  const getEventsForMonth = () => {
    return events.filter(
      (event) =>
        event.date.getMonth() === currentMonth && event.date.getFullYear() === currentYear
    );
  };

  const handleMonthChange = (increment) => {
    const newMonth = increment ? (currentMonth + 1) % 12 : currentMonth === 0 ? 11 : currentMonth - 1;
    const newYear = increment
      ? currentMonth === 11
        ? currentYear + 1
        : currentYear
      : currentMonth === 0
      ? currentYear - 1
      : currentYear;

    setCurrentMonth(newMonth);
    setCurrentYear(newYear);
  };

  const calendarContainerStyle = {
    width: '100%',
    height: '100%',
    border: 'none',
    borderRadius: '0',
    padding: '0',
    backgroundColor: '#fff',
    boxShadow: 'none',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    margin: '0',
  };

  const pageStyle = {
    backgroundColor: '#000',
    height: '100vh',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  };

  if (loading) {
    return <p>Loading...</p>;
  }

  return (
    <div style={pageStyle}>
      <Navbar />
      <div style={calendarContainerStyle}>
        <div style={{ display: 'flex' }}>
          <div style={{ display: 'flex', flexDirection: 'column' }}>
            <Calendar
              onChange={setDate}
              value={date}
              tileContent={tileContent}
              tileDisabled={() => false}
              tileClassName={({ date }) => {
                const isWeekend = date.getDay() === 0 || date.getDay() === 6;
                return isWeekend ? 'weekend' : null;
              }}
              navigationLabel={({ date }) =>
                `${date.toLocaleString('default', { month: 'long' })} ${date.getFullYear()}`
              }
              onClickMonth={handleMonthChange}
              prev2Label={null}
              next2Label={null}
              showNeighboringMonth={false}
            />
            <div style={{ display: 'flex', justifyContent: 'center', marginTop: '10px' }}>
              <button onClick={() => handleMonthChange(false)} style={{ marginRight: '10px' }}>
                Previous Month
              </button>
              <button onClick={() => handleMonthChange(true)}>Next Month</button>
            </div>
          </div>
          <div style={{ marginLeft: '20px' }}>
            <h2>
              Events for{' '}
              {new Date(currentYear, currentMonth).toLocaleString('default', {
                month: 'long',
              })}{' '}
              {currentYear}
            </h2>
            {getEventsForMonth().length > 0 ? (
              getEventsForMonth().map((event, index) => (
                <div
                  key={index}
                  style={{
                    display: 'flex',
                    alignItems: 'center',
                    marginBottom: '10px',
                  }}
                >
                  <div
                    style={{
                      width: '20px',
                      height: '20px',
                      backgroundColor: event.color,
                      marginRight: '10px',
                    }}
                  />
                  <span>{event.title}</span>
                </div>
              ))
            ) : (
              <p>No events for this month</p>
            )}
          </div>
        </div>
      </div>
    </div>
  );
}

export default CustomCalendar;
